import React from 'react';
import bc3 from '../bc3.png';
import '../styles/Header.css';



function Header() {
  return (

    <nav>
    <div class="carousel-inner">

      <img src={bc3} className="bc3" alt ="Screenshot of logo" />
        <div class="carousel-caption">
        </div>
      </div>
  </nav>
  );
}

export default Header;
